*{font-family:arial}  img {
    transform: scale(0.75) translate(24px, 0);
    opacity: 80%;
  }.startPage{position:absolute;width:360px;height:375px;z-index:0;transition:transform 0.3s ease}.startPage:hover{transform:translateY(-1%)}.classnew{display:flex;align-items:center;justify-content:center;flex-direction:column;margin-top:24px;margin-bottom:24px}.hoverContainer :last-child{margin-bottom:0}.hoverContainer{background:black;border-radius:27px;padding:18px;display:flex;flex-direction:column;align-items:flex-start;justify-content:flex-start;align-self:stretch;flex-shrink:0;height:fit-content;max-width:336px;position:relative;margin-bottom:12px;left:50%;height:min-content;top:50%;transform:translate(-50%,-50%)}.header_discrip{font-size:21px;font-weight:200;color:#6f6f6f;width:fit-content}.h1{font-size:37.5px;margin:12px 0;font-weight:700;text-align:center}.size-smallButton{font-size:21px;border-radius:12px;height:48px;min-width:48px;display:flex;align-items:center;width:93%;margin-top:12px;justify-content:center;cursor:pointer}.style-input{background:#2a2a2b;border-radius:12px;padding:12px}.style-input:hover{background:#3b3b3c}.header{padding-bottom:12px;margin-bottom:12px;border-bottom:1px solid #3e3e3e;width:100%;height:36px;display:flex;align-items:center;justify-content:space-between;flex-direction:row}a{width:100%;color:#B6B6B7}a:hover,a:hover .header_discrip{color:#DDDDDD!important}

body { height: 50px; width: 50px; }
* { font-family: arial; }
div { height: 100%; }
.hoverContainer { height: 320px; width: 520px; }
iframe { position: absolute; top: 0; left: 0; right: 0; height: 100%; border: none; }
.hoverContainer {
    background: black;
    border-radius: 28px;
    padding: 18px;
    display: flex;
    flex-direction: column;
    position: relative;
    margin-bottom: 12px;
    left: 50%;
    top: 50%;
    transform: translate(-50%, -50%);
}
.header_discrip { font-size: 21px; font-weight: 300; color: #6f6f6f; width: fit-content; }
.header {
    padding-bottom: 12px;
    width: 100%;
    height: 36px;
    display: flex;
    align-items: center;
    justify-content: space-between;
    flex-direction: row;
}
